import React,{useState} from 'react'

function Logout() {

    const [check, setCheck] = useState(true)

    return (
        <div className='logoutContainer'>
            <label className='switch'>
                <input
                    type='checkbox'
                    btnCheck={check}

                />
                <span className='slider round'></span>
            </label>
         </div>
    )
}

export default Logout
